import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  Outlet,
  useParams
} from 'react-router-dom';
import Dave from './screens/data/Dave.jpg';

import "./App.css";
import Header from "./components/Header/Header";
import HeaderButton from "./components/HeaderButtons/HeaderButton";
import ProjectScreen from './screens/ProjectsScreen';
import Background from "./Background";
import ProjectsScreen from "./screens/ProjectsScreen";
import AboutMe from './screens/AboutMe';

import Typist from 'react-typist';

import Projects from './screens/data/Projects';


function Home() {
  return (
    <div style={{ padding: 20 }}>

    <Centre/>
      {/* <h2>Home View</h2> */}
      {/* <p>Lorem ipsum dolor sit amet, consectetur adip.</p> */}
    </div>
  );
}


function Centre() {
  const linkedIn = 'https://www.linkedin.com/in/david-hostler-a8480b12b';
  return (
    <div id="text_div center_all">
      <div className="center_all">
        <h2 className="custom-subTitle"
        style={{textAlign: 'center'}}
        >David Hostler</h2> 


        <img src={Dave}
        style={{borderRadius: '50%'}}
        />


      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      {/* <Header/> */}
      <nav style={{ margin: 10 }}>
        <ul>
        <Link to="/" style={{ padding: 5 }}>
          <HeaderButton title="Home">Home</HeaderButton>
        </Link>
        {/* <Link to="/Projects" style={{ padding: 5 }}>
          <HeaderButton title="Projects">
          Projects  
          </HeaderButton>
        </Link> */}
        <Link to="/Projects">
          <HeaderButton title="Projects">
            Projects
          </HeaderButton>
        </Link>
        <Link to="/AboutMe" style={{ padding: 5 }}>
        <HeaderButton title="About Me">
          About Me
          </HeaderButton>
        </Link>
        </ul>
      </nav>
      {/* Rest of the code remains same */}
      <Routes>
        <Route path="/" element={<Home />} />
        {/* <Route path="/Projects" element={<ProjectsScreen />} /> */}

        <Route path="/Projects" element = {<Projects/>}/>
        <Route path="/AboutMe" element={<AboutMe />}>
          {/* <Route path=":slug" element={<Post />} /> */}
        </Route>
      </Routes>
      <Background/>

    </Router>
  );
}

export default App;


